import React from 'react'
import {Avatar, FormControlLabel, Grid, Paper, TextField, Switch, Button} from '@material-ui/core'
import VpnKeyIcon from '@material-ui/icons/VpnKey';
const SignIn=()=>{
    const paperStyle={padding :20, height:'70vh', width:280, margin:'20px auto'}
    const avatarStyle={backgroundColor:'#E2D2D2',margin:'10px'}
    const textfieldStyle={margin:'10px auto'}
    return(
        <Grid>
            <Paper elevation={5} style={paperStyle}>
                <Grid align='center'>
                    <Avatar style={avatarStyle} variant='rounded'><VpnKeyIcon/></Avatar>
                    <h2>Sign in</h2>
                </Grid>
                <TextField style={textfieldStyle} id="outlined-basic" variant="outlined" label='Username' placeholder='Enter username' align='center' fullWidth required/>
                <TextField style={textfieldStyle} id="outlined-basic" variant="outlined" label='Password' placeholder='Enter password' align='center' type='password' fullWidth required/>
                <Grid>
                <FormControlLabel
                    control={<Switch name="switchA" color="primary"/>}
                    label="Remember me"
                />
                </Grid>
                <Button type="submit" color='primary' variant='contained' fullWidth>Sign in</Button>
            </Paper>
        </Grid>
    )
}
export default SignIn
